fetch("https://jsonplaceholder.typicode.com/users").then((e=>e.json())).then((e=>{const n=document.querySelector(".admin__wrapper");for(let t=0;t<e.length;t++){const s=document.createElement("div");s.classList.add("admin__content"),s.innerHTML=`\n      ${e[t].id}) \n      ${e[t].name},\n      ${e[t].username}, \n      <a href="mailto:${e[t].email}">${e[t].email}</a>, \n      ${e[t].address.street}, \n      ${e[t].address.suite}, \n      ${e[t].address.city}, \n      ${e[t].address.zipcode}`,n.append(s)}}));